import React from 'react'
import AppLoading from './layout/AppLoading';

class Configs extends React.Component{
    constructor(){
        super()
        this.state = {
            isLoading: true
        }
    }


    render(){
        return (
            <div className="page">
                <div class="page-header page-header-bordered">
                    <h1 class="page-title">Configure seu Negócio</h1>
                    <ol class="breadcrumb">
                        <li class="breadcrumb-item active">
                            Precisamos saber mais sobre seu negócio
                        </li>
                    </ol>
                </div>
                <div className="page-content container-fluid">
                    <p>Teste</p>
                </div>
            </div>
        )
    }
}

export default Configs
